pragma solidity ^0.4.24;
pragma experimental ABIEncoderV2;
import "./Account.sol";
import "./Store.sol";
import "./Order.sol";


contract Main {

    address public owner;
    Account public account;
    Store public store;
    Order public order;

    /*****************************************************************
    ************************    定义事件    ***************************
    *****************************************************************/

    event RegisterEvent (address indexed userAddress, string ipfsHash);

    event ChangeInfoEvent (address indexed userAddress, string ipfsHash);

    event AddGoodsEvent (address indexed userAddress, string index, string ipfsHash, 
    uint256 userNum, uint256 homeNum, uint256 price);

    event ChangeGoodsEvent (address indexed userAddress, string index, uint256 userNum, 
    uint256 homeNum, string oldHash, string newHash, uint256 price);

    event NewOrderEvent (address seller, address buyer, address orderAddress, string ipfsHash, uint256 price);

    event OrderDoneEvent (address indexed buyer, address indexed order);

    event RefundEvent (address indexed buyer, address indexed order);

    event RefundAgreeEvent (address indexed seller, address indexed order);
    /*****************************************************************
    ************************    写入函数    ***************************
    *****************************************************************/

    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }

    constructor () public payable {
        owner = msg.sender;
    }

    function changeOwner(address _owner) public onlyOwner {
        owner = _owner;
    }

    function updateMain(address _newMain) public onlyOwner {
        account.changeOwner(_newMain);
        store.changeOwner(_newMain);
    }

    function link(address _account, address _store) public onlyOwner {
        account = Account(_account);
        store = Store(_store);
    }

    //注册账户 [将用户信息存储在IPFS上，这里只保存ipfs的哈希值]
    function register(string ipfsHash) public {
        account.register(msg.sender, ipfsHash);
        emit RegisterEvent(msg.sender, ipfsHash);
    }

    //更新账户信息
    function changeInfo(string ipfsHash) public {
        account.changeInfo(msg.sender, ipfsHash);
        emit ChangeInfoEvent(msg.sender, ipfsHash);
    }

    //上传商品信息
    function addGoods(string index, string ipfsHash, bytes32 ipfsHash1, bytes14 ipfsHash2, uint256 price) public {
        uint256 homeNum = store.addGoods(index, ipfsHash, ipfsHash1, ipfsHash2, price);
        uint256 userNum = account.addGoods(msg.sender, ipfsHash, ipfsHash1, ipfsHash2, homeNum);
        emit AddGoodsEvent(msg.sender, index, ipfsHash, userNum, homeNum, price);
    }

    //更改商品信息(目前只支持单一标签，比如城市)
    function changeGoods(
        uint256 userNum, uint256 homeNum, string oldHash, string newHash, 
        bytes32 ipfsHash1, bytes14 ipfsHash2, string index, uint256 price
        ) public {
        account.changeGoods(msg.sender, userNum, homeNum, oldHash, newHash, ipfsHash1, ipfsHash2);
        store.changeGoods(index, homeNum, oldHash, newHash, ipfsHash1, ipfsHash2, price);
        emit ChangeGoodsEvent(msg.sender, index, userNum, homeNum, oldHash, newHash, price);
    }

    //买家下单（买家发起）
    function newOrder(address seller, string ipfsHash, string startTime) public payable {
        //部署新合约，合约应该与买家和卖家联系起来，可以通过买家或者卖家的地址找到这个订单合约的地址
        //可以存储在Stroge合约中
        //在部署合约的时候，直接将参数传进订单合约中（买方，卖方，房子id，金额，规则等）
        require(account.verifySeller(seller, ipfsHash), "seller don`t have this goods");
        uint256 price = store.getPrice(ipfsHash);
        require(msg.value == price * 1e18, "pay wrong value!");
        Order orderInstance = new Order(seller, msg.sender, ipfsHash, price, startTime);
        account.addOrder(msg.sender, seller, address(orderInstance));
        address(orderInstance).transfer(msg.value);
        emit NewOrderEvent(msg.sender, seller, orderInstance, ipfsHash, price);
    }

    //订单完成（买家发起，还需要其他方式，比如时间）
    function orderDone(address orderAddress, string endTime) public {
        Order orderInstance = Order(orderAddress);
        orderInstance.orderDone(msg.sender, endTime);
        emit OrderDoneEvent(msg.sender, orderAddress);
    }

    //买家申请退款（买家发起）
    function refundApply(address orderAddress) public {
        Order orderInstance = Order(orderAddress);
        orderInstance.refundApply(msg.sender);
        emit RefundEvent(msg.sender, orderAddress);
    }

    //卖家同意退款（卖家发起，还需要其他监督方式）
    function refundAgree(address orderAddress, string endTime) public {
        Order orderInstance = Order(orderAddress);
        orderInstance.refundAgree(msg.sender, endTime);
        emit RefundAgreeEvent(msg.sender, orderAddress);
    }
    /*****************************************************************
    ************************    查询函数    ***************************
    *****************************************************************/

    //获取用户信息
    function getInfo(address userAddress) public view returns (
        bool registed, string infoHash, uint256 orderCount, uint256 goodsCount
        ) {
        (registed, infoHash, orderCount, goodsCount) = account.getInfo(userAddress);
    }

    //查询订单地址
    function getOrders() public view returns (address[]) {
        return account.getOrders(msg.sender);
    }

    //根据订单地址查询订单信息
    function getOrderInfo(address orderAddress) public view returns (
        address seller,   //卖家地址
        address buyer,    //买家地址
        string ipfsHash,  //商品信息的哈希地址
        uint256 price,    //商品价格
        string startTime, //订单开始时间
        string endTime,   //订单结束时间
        bool done,        //订单是否完成
        bool refund,      //是否申请退款
        bool agreeRefund  //是否同意退款
    ) {
        Order.OrderInfo memory info = Order(orderAddress).getOrderInfo();
        seller = info.seller;
        buyer = info.buyer;
        ipfsHash = info.ipfsHash;
        price = info.price;
        startTime = info.startTime;
        endTime = info.endTime;
        done = info.done;
        refund = info.refund;
        agreeRefund = info.agreeRefund;
    }

    //查询商家的全部商品[Account合约]
    function getGoods (address sellerAddress) public view returns (bytes32[] goods1, bytes14[] goods2) {
        (goods1, goods2) = account.getGoods(sellerAddress);
    }

    //根据标签获取首页全部商品信息
    function getIndexGoods (string index) public view returns (bytes32[] goods1, bytes14[] goods2) {
        (goods1, goods2) = store.getIndexGoods(index);
    }

    //获取商品number
    function getNumber(string ipfsHash) public view returns (uint256[2]) {
        return account.getNumber(msg.sender, ipfsHash);
    }

}
